import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 17.1-411 Review by the Supreme Court.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-411.md","filePath":"vacode/17.1-411.md"}'),o={name:"vacode/17.1-411.md"},i=a('<h1 id="§-17-1-411-review-by-the-supreme-court" tabindex="-1">§ 17.1-411 Review by the Supreme Court. <a class="header-anchor" href="#§-17-1-411-review-by-the-supreme-court" aria-label="Permalink to &quot;§ 17.1-411 Review by the Supreme Court.&quot;">​</a></h1><p>Except where the decision of the Court of Appeals is made final under § <a href="http://law.lis.virginia.gov/vacode/17.1-410/" target="_blank" rel="noreferrer">17.1-410</a> or § <a href="http://law.lis.virginia.gov/vacode/19.2-408/" target="_blank" rel="noreferrer">19.2-408</a>, any party aggrieved by a final decision of the Court of Appeals, including the Commonwealth, may petition the Supreme Court for an appeal. The Commonwealth, or any county, city, or town, may also petition the Supreme Court for review pursuant to § <a href="http://law.lis.virginia.gov/vacode/19.2-317/" target="_blank" rel="noreferrer">19.2-317</a>. The granting of such petitions shall be in the discretion of the Supreme Court.</p><p>1983, c. 413, § 17-116.08; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0358" target="_blank" rel="noreferrer">358</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872" target="_blank" rel="noreferrer">872</a>.</p>',3),n=[i];function l(c,p,h,s,_,u){return r(),t("div",null,n)}const g=e(o,[["render",l]]);export{d as __pageData,g as default};
